Kanan kamachiykuna:
  @show              ─ qhipa adaptivo tarjeta pisillayninta rikuchiy
  @json              ─ flujo-manta chaskisqa crudo JSON chaninta lluqsichiy
  @back              ─ ñawpaq hark'asqa tarjeta/yaykuykunaman kutiy
  @input <k>=<v>     ─ huk yaykuy pampata churay utaq allinchay
  @click <action_id> ─ qosqa acciónwan tarjetata apachiy
  @help              ─ kay yanapay qillqata imprimir
  @quit              ─ REPLmanta lluqsiy
